import githubLogo from 'images/github-mark-white.png';

const Footer = () => {
    return (
        <footer>
            <a href="https://github.com/NobleDot">
                <img class="nav-item" id="gh-icon" src="images/github-mark-white.png"></img>
            </a>
        </footer>
    )
}

export default Footer;
